import React from 'react'



function Header() {
    return (
     
      <ul class="nav justify-content-center">
        <li class="nav-item">
          <a class="nav-link active" href="#">Add Time Table</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" >Update</a>
        </li>
        <li class="nav-item">
          <a class="nav-link">Delete</a>
        </li>
        
      </ul>
    )}
export default Header;
